import React from "react";
import { Routes, Route } from "react-router-dom";



import Home from "./components/Home.jsx"
import ClassA from"./components/ClassA.jsx"
import Teacher from"./components/Schedule.jsx"
import Information from"./components/Information.jsx"
import InformationStudents from"./components/InformationStudents.jsx"
import Login from"./components/Login.jsx"

function App() {
  return (
    <>
      <Routes>
      <Route path="/" element={<Home/>}/>
      <Route path="ClassA" element={<ClassA/>}/>
      <Route path="schedule" element={<Teacher/>}/>
      <Route path="Information" element={<Information/>}/>
      <Route path="InformationStudents" element={<InformationStudents/>}/>
      <Route path="InformationStudents" element={<InformationStudents/>}/>
      </Routes>
    </>
  );
}

export default App;
